import React from "react";
import "./Card.component.css";
export default function Card() {
  return (
    <div>
      <div
        className="cards"
        style={{
          display: "grid",
          gridColumn: "3",
          justifyContent: "space-around",
          minWidth: "200px",
          alignItems: "center",
          border: "1px solid #e3e3e3",
          boxShadow: "10px 10px 50px 0px rgba(224,224,224,1)",
        }}
      >
        <div style={{ width: "100px" }}>
          <h3>name</h3>

          <div>
            <h4>desc</h4>
          </div>
          <div>
            <button>Add</button>
          </div>
        </div>
      </div>
    </div>
  );
}
